const LoginPage = require('../pageobjects/Login/login.page')
const SecurePageForLogin = require('../pageobjects/Login/secure.page')

const HomePageToAddPatient = require("../pageobjects/HomePageToAddPatient/goToPatientDetails.page")
const SecurePageForHomePageToAddPatient = require("../pageobjects/HomePageToAddPatient/secure.page")

const AddPatient = require("../pageobjects/AddPatient/addPatientDetails.page")
const SecurePageForAddPatient = require('../pageobjects/AddPatient/secure.page')

const ScheduleAppointment = require("../pageobjects/ScheduleAppointment/scheduleAppointment.page")

// const faker = require("@faker-js/faker")


describe('My Login application', () => {
    it('should login with valid credentials', async () => {
        await LoginPage.open()

        await LoginPage.login('Admin', 'Admin123')
        await expect(SecurePageForLogin.flashAlert).toBeExisting()
        await expect(SecurePageForLogin.flashAlert).toHaveTextContaining(
            'Logged in as Gaurav Jaiswal (Gaurav) at Registration Desk.')
    })
})

describe("Home Page", () => {
    it("should go to add patient details page", async () => {
        await HomePageToAddPatient.open()

        await expect(SecurePageForHomePageToAddPatient.flashAlert).toBeExisting()
        await expect(SecurePageForHomePageToAddPatient.flashAlert).toHaveTextContaining('Register a patient');
    })
});

