    async addVitalsDetails(temperature, pulse, respiratoryRate, bloodPressureSystolic, bloodPreesureDiastolic, bloodOxygen) {
        await this.nextButton.click()

        await this.temperature.setValue(temperature)
        await this.nextButton.click()

