        await this.bloodPreesureDiastolic.setValue(bloodPreesureDiastolic)
        await this.nextButton.click()

        await this.bloodOxygen.setValue(bloodOxygen)
        await this.nextButton.click()

        await this.submitBtn.click()
    }
}
