const BasePaths = require('../pageobjects/Package/package')
const [{LoginPage,HomePageToFindSearchRecord,FindSeachRecords,PatientDetailsPageToEditRegistrationInformation,EditRegistration}] = [BasePaths.getPagePaths()]
