    get familyName() {
        return $(`[name="familyName"]`)
    }
    get birthdayDate() {
        return $(`#birthdateDay-field`)
    }
    get nextBtn() {
        return $(`#next-button`)
    }
    get registrationSubmit() {
        return $('#registration-submit')
